jQuery(document).ready(function(){
 function htmSlider(){
  /* ÐÐ°Ð´Ð°Ð´Ð¸Ð¼ ÑÐ»ÐµÐ´ÑÑÑÐ¸Ðµ Ð¿Ð°ÑÐ°Ð¼ÐµÑÑÑ */
  /* Ð¾Ð±ÐµÑÑÐºÐ° ÑÐ»Ð°Ð¹Ð´ÐµÑÐ° */
  var slideWrap = jQuery('.slide-wrap');
  /* ÐºÐ½Ð¾Ð¿ÐºÐ¸ Ð²Ð¿ÐµÑÐµÐ´/Ð½Ð°Ð·Ð°Ð´ Ð¸ ÑÑÐ°ÑÑ/Ð¿Ð°ÑÐ·Ð° */
  var nextLink = jQuery('.next-slide');
  var prevLink = jQuery('.prev-slide');
  var playLink = jQuery('.auto');
  /* ÐÑÐ¾Ð²ÐµÑÐºÐ° Ð½Ð° Ð°Ð½Ð¸Ð¼Ð°ÑÐ¸Ñ */
  var is_animate = false;
  /* ÑÐ¸ÑÐ¸Ð½Ð° ÑÐ»Ð°Ð¹Ð´Ð° Ñ Ð¾ÑÑÑÑÐ¿Ð°Ð¼Ð¸ */
  var slideWidth = jQuery('.slide-item').outerWidth();
  /* ÑÐ¼ÐµÑÐµÐ½Ð¸Ðµ ÑÐ»Ð°Ð¹Ð´ÐµÑÐ° */
  var scrollSlider = slideWrap.position().left - slideWidth;
		
  /* ÐÐ»Ð¸Ðº Ð¿Ð¾ ÑÑÑÐ»ÐºÐµ Ð½Ð° ÑÐ»ÐµÐ´ÑÑÑÐ¸Ð¹ ÑÐ»Ð°Ð¹Ð´ */
  nextLink.click(function(){
   if(!slideWrap.is(':animated')) {
    slideWrap.animate({left: scrollSlider}, 500, function(){
     slideWrap
      .find('.slide-item:first')
      .appendTo(slideWrap)
      .parent()
      .css({'left': 0});
    });
   }
  });

  /* ÐÐ»Ð¸Ðº Ð¿Ð¾ ÑÑÑÐ»ÐºÐµ Ð½Ð° Ð¿ÑÐµÐ´ÑÐ´ÑÑÑÐ¸Ð¹ ÑÐ»Ð°Ð¹Ð´ */
  prevLink.click(function(){
   if(!slideWrap.is(':animated')) {
    slideWrap
     .css({'left': scrollSlider})
     .find('.slide-item:last')
     .prependTo(slideWrap)
     .parent()
     .animate({left: 0}, 500);
   }
  });
		
  /* Ð¤ÑÐ½ÐºÑÐ¸Ñ Ð°Ð²ÑÐ¾Ð¼Ð°ÑÐ¸ÑÐµÑÐºÐ¾Ð¹ Ð¿ÑÐ¾ÐºÑÑÑÐºÐ¸ ÑÐ»Ð°Ð¹Ð´ÐµÑÐ° */
  function autoplay(){
   if(!is_animate){
    is_animate = true;
    slideWrap.animate({left: scrollSlider}, 500, function(){
     slideWrap
      .find('.slide-item:first')
      .appendTo(slideWrap)
      .parent()
      .css({'left': 0});
     is_animate = false;
    });
   }
  }
		
  /* ÐÐ»Ð¸ÐºÐ¸ Ð¿Ð¾ ÑÑÑÐ»ÐºÐ°Ð¼ ÑÑÐ°ÑÑ/Ð¿Ð°ÑÐ·Ð° */
  playLink.click(function(){
   if(playLink.hasClass('play')){
    /* ÐÐ·Ð¼ÐµÐ½ÑÐµÐ¼ ÐºÐ»Ð°Ñ Ñ ÐºÐ½Ð¾Ð¿ÐºÐ¸ Ð½Ð° ÐºÐ»Ð°Ñ Ð¿Ð°ÑÐ·Ñ */
	playLink.removeClass('play').addClass('pause');
    /* ÐÐ¾Ð±Ð°Ð²Ð»ÑÐµÐ¼ ÐºÐ½Ð¾Ð¿ÐºÐ°Ð¼ Ð²Ð¿ÐµÑÐµÐ´/Ð½Ð°Ð·Ð°Ð´ ÐºÐ»Ð°Ñ ÐºÐ¾ÑÐ¾ÑÑÐ¹ Ð¸Ñ ÑÐºÑÑÐ²Ð°ÐµÑ */
    jQuery('.navy').addClass('disable');
    /* ÐÐ½Ð¸ÑÐ¸Ð°Ð»Ð¸Ð·Ð¸ÑÑÐµÐ¼ ÑÑÐ½ÐºÑÐ¸Ñ autoplay() ÑÐµÑÐµÐ· Ð¿ÐµÑÐµÐ¼ÐµÐ½Ð½ÑÑ
       ÑÑÐ¾Ð±Ñ Ð¿Ð¾ÑÐ¾Ð¼ Ð¼Ð¾Ð¶Ð½Ð¾ Ð±ÑÐ»Ð¾ ÐµÐµ Ð¾ÑÐºÐ»ÑÑÐ¸ÑÑ
	*/
    timer = setInterval(autoplay, 1000);
   } else {
    playLink.removeClass('pause').addClass('play');
	/* Ð¿Ð¾ÐºÐ°Ð·ÑÐ²Ð°ÐµÐ¼ ÐºÐ½Ð¾Ð¿ÐºÐ¸ Ð²Ð¿ÐµÑÐµÐ´/Ð½Ð°Ð·Ð°Ð´ */
    jQuery('.navy').removeClass('disable');
    /* ÐÑÐºÐ»ÑÑÐ°ÐµÐ¼ ÑÑÐ½ÐºÑÐ¸Ñ autoplay() */
    clearInterval(timer);
   }
  });

 }
 
 /* Ð¸Ð½Ð¸ÑÐ¸Ð»Ð¸Ð·Ð¸ÑÑÐµÐ¼ ÑÑÐ½ÐºÑÐ¸Ñ ÑÐ»Ð°Ð¹Ð´ÐµÑÐ° */
 htmSlider();
});



